  return
  <div id="app">
    <h1>Fundamentos React</h1>
    <Fragmento />
    <ComParametro
      titulo="Situação do Aludo"
      aluno="Dennys Fernandes"
      nota={9.3}
    />
    <Primeiro></Primeiro>
  </div>;
}
